   // Sending ClientId to Shutterstock iframes
   var clientId = undefined;
   var iframeQueue = [];

   function sendClientId()
   {
       while (iframeQueue.length>0)
       {
           var iframe = iframeQueue.pop();
           // Extract domain from iframe src
           var parser = document.createElement('a');
           parser.href = iframe.src;
           var target = parser.protocol+'//'+parser.hostname;
           iframe.contentWindow.postMessage(clientId, target);
       }
   }
   function askForClientId(element)
   {
       iframeQueue.push(element);
       if (clientId)
       {
           sendClientId();
       }
   }

   ga(function (tracker) {
       clientId = tracker.get('clientId');
       sendClientId();
   });

   if (window.performance && document.addEventListener && window.addEventListener) {
       document.addEventListener('DOMContentLoaded', function () {
           ga('send', 'timing', 'performance', 'DOMContentLoaded', Math.round(performance.now()) /* TODO: 'Highwinds CDN' | 'Edgecast CDN' | 'OVH' */);
       });
   }

   function ga_logged_in_callback(data) {
       var userType = !data.status ? 'guest' : (data.premium ? 'premium' : 'registered');
       ga('set', 'dimension1', userType);
       if (data.id) {
           ga('set', 'userId', data.id);
       }
   }

   function logged_in_callback(data) {
       ga_logged_in_callback(data);
   }

form.script:
var search_type;
try {
    search_type = localStorage.getItem("search-type");
} catch (e) {
    search_type = 'icons';
}

var search_str = {
    'Icons': 'Icons',
    'Packs': 'Packs',
};
if (search_type)
{
    document.querySelector(".search-holder .type-selector input[name=search-type][value='"+search_type+"']").checked = true;
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = search_str[search_type.charAt(0).toUpperCase() + search_type.slice(1)];
}
if (window.location.pathname == '/packs' || window.location.pathname.search('icon-packs') != -1) {
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = 'Packs';
    document.querySelector(".search-holder .type-selector input[name=search-type][value='packs']").checked = true;
}

section.script:
var DEFAULT_AVATAR = 'https://image.flaticon.com/img/default_avatar.png';
function set_default_avatar(elem)
{
    elem.src = DEFAULT_AVATAR;
}

var pageview;
try {
    pageview = parseInt(localStorage.pageview || 0, 10)
} catch(e) {
    pageview = 1;
}

if (pageview < 3){
    var login_link = document.getElementById("gr_not-connected");
    login_link.classList.add("dropdown-active");
    try {
        localStorage.pageview = pageview + 1;
    } catch(e) {}

    setTimeout(function() {
        var login_link = document.getElementById("gr_not-connected");
        if (login_link) {
            login_link.classList.remove('dropdown-active');
        }
    }, 4000);
}

    var total_found_packs = 5;
        function parseQueryString(a) {
            a = a.substr(1).split('&');
            if (a == "") return {};
            var b = {};
            for (var i = 0; i < a.length; ++i)
            {
                var p=a[i].split('=', 2);
                if (p.length == 1)
                    b[p[0]] = "";
                else
                    b[p[0]] = decodeURIComponent(p[1].replace(/\+/g, " "));
            }
            return b;
        }
        if (document.getElementById('word'))
        {
            var opt = {'metric1': 1};
            var searchTerm = parseQueryString(document.getElementById('word').value);
            if (searchTerm !== undefined) { opt['dimension9'] = searchTerm; }
            ga('send', 'event', 'Search', 'Icon', opt);
        }
        function hideBox() {
            //Reset
            var queryString = parseQueryString(window.location.search);
            var query = [];
            for (var k in queryString){
                if (k !== "word") {
                    query.push(k + "=" + queryString[k]);
                }
            }
            query = query.join('&');
            if (query) {
                query = '?' + query;
            }
            $('.overlay-more').remove();
             $('.search-pack-result .box').show();
            if (document.querySelector('section.search-pack-result')) {
                document.querySelector('section.search-pack-result').classList.remove('hidden');
            }
            var containerWidth = $('.search-pack-result').innerWidth();
            var boxWidth = $('.search-pack-result .box').outerWidth()+30;
            var boxTotal = $('.search-pack-result .box').length;
            for (var i=1;i<=boxTotal;i++)
            {
                if (boxWidth * i > containerWidth)
                {
                    break;
                }
            }
            if (boxTotal>=i)
            {
                var html = 'View %s more';
                var more = total_found_packs-i+2;
                if (more == total_found_packs) html = html.replace(" more", " packs").replace(" más", " packs");
                html = html.replace("%s", more);
                $('.search-pack-result .box:nth-child('+ i +') a').prepend(html);
                $('.search-pack-result .box:nth-child(n+'+ (i+1) +')').hide();
            }
        }
if (total_found_packs)
{
    document.addEventListener("DOMContentLoaded", function(event) {
        hideBox();
        $(window).on('resize', function() {
            hideBox();
        });
    });
}

	var download_types = ['icon','pack','collection'];
	var ga_arguments_premium, mix_panel_json_premium, ga_arguments_copy, ga_credit_arguments_copy;
	var licence;

	function check_modal_download(type,element_type) {
		if (download_types.indexOf(type)==-1) {
			return;
		}

		var modal = document.querySelector('div.modal-download');
		var modal_credit = document.querySelector('div.modal-credit');

		if (modal) {
			// SHOW & HIDE ELEMENTS
			modal_download_toogle_all(modal,modal_credit,type);

			// ICON
			if (type == 'icon') {
				check_modal_download_icon(modal,modal_credit,element_type);
			}

			// COLLECTION
			if (type == 'collection') {
				check_modal_download_collection(modal,modal_credit);
			}

			// PACK
			if (type == 'pack') {
				check_modal_download_pack(modal,modal_credit);
			}

			document.getElementById('modal-download').checked = true;
			return;
		}	
	}

	function modal_download_toogle_all(modal,modal_credit,type) 
	{				
		modal.classList.add('modal-'+type);		

		modal.querySelector('#download-premium').classList.add('modal-'+type);
		modal.querySelector('#download-free').classList.add('modal-'+type);

		modal.querySelector('.modal-body').classList.remove('nopremium');

		//  SHOW ALL
		[].forEach.call(modal.querySelectorAll('.hidden'), function(all_element) {
			if (all_element && all_element.classList.contains('hidden')) {
				all_element.classList.remove('hidden');
			} 
		});

		[].forEach.call(modal_credit.querySelectorAll('.hidden'), function(all_element) {
			if (all_element && all_element.classList.contains('hidden')) {
				all_element.classList.remove('hidden');
			} 
		});

		// GENERAL HIDE
		download_types.forEach(function (t) {
			if (t != type) {

				modal.classList.remove('modal-'+t);		
				modal.querySelector('#download-premium').classList.remove('modal-'+t);
				modal.querySelector('#download-free').classList.remove('modal-'+t);	

				[].forEach.call(modal.querySelectorAll('.modal-'+t), function(element_hide) {
					element_hide.classList.add('hidden');
				});
			}

		});
	}

	/**
	*
	*/
	function check_modal_download_icon(modal, modal_credit, element_type) 
	{

		ga_arguments_premium = ['send', 'event', 'Detail View', 'Premium Download'];
		mix_panel_json_premium = {'source': 'not-premium-detail', 'download-type': 'single', 'website': 'flaticon'};
		ga_arguments_copy = ['send', 'event', 'Detail View', 'Select Attribution Link'];
		ga_credit_arguments_copy = ['send', 'event', 'Detail View', 'Select Credit Attribution Link'];

		document.querySelector('.fi-modal #download-free').addEventListener('click',download_final);
		document.querySelector('.fi-modal #copy-attributtion').addEventListener('click',apply_ga_attributtion);
		document.querySelector('.modal-credit #copy-attributtion-credit').addEventListener('click',apply_ga_attributtion_credit);
		document.querySelector('.fi-modal #download-premium').addEventListener('click',apply_ga_download_premium);

		var download_form = document.getElementById('download-form');

		if (element_type) {

			// DESDE EL LISTADO
		    modal.querySelector('p.filename img').setAttribute('src', element_type.querySelector('img').getAttribute('src'));

			modal_credit.querySelector('.col--img').classList.remove('hidden');
		    modal_credit.querySelector('.col--img').style.backgroundImage = "url('"+ element_type.querySelector('img').getAttribute('src') +"')";

		    modal.querySelector('p.filename span.description').innerHTML = element_type.dataset.name;
		    modal.querySelector('p.author span.description').innerHTML = 'By ' + element_type.dataset.author_name;
		    modal.querySelector('p.author img').setAttribute('src', element_type.dataset.author_avatar);

				if (element_type.dataset.selection == 0) {
					modal.querySelector('.modal-body').classList.add('nopremium');
					modal.querySelector('.column-premium').style.display = 'none';
				} else {
					modal.querySelector('.column-premium').style.display = 'block';
				}

		    licence = '
Icons made by '+element_type.dataset.author_name+' from www.flaticon.com is licensed by CC 3.0 BY';

		} else {

			// DESDE EL DETALLE
			if (download_form) {

				var icon_info = (document.querySelector('#detail')) ? document.getElementById('detail') : document.getElementById('detail-content');

				var description = icon_info.querySelector('h1 .title').innerHTML;
				modal.querySelector('.filename .description').innerHTML = description;
				modal.querySelector('.filename img').alt = description;

				var main_img = icon_info.querySelector('.main-icon img');
				if(!main_img) {
					main_img = icon_info.querySelector('.main-icon-without-slide img');
				}
				modal.querySelector('.filename img').src = main_img.src;


				modal_credit.querySelector('.col--img').classList.remove('hidden');
		    	modal_credit.querySelector('.col--img').style.backgroundImage = "url('"+ main_img.src +"')";

				var author_link = icon_info.querySelector('.author a.avatar'); 
				var author_img = icon_info.querySelector('.author a.avatar img');

